%% FUNCTION FOR DETERMINING THE FINAL CONCENTRATION OF NITRATE

%% INITIATE THE START OF INPUTS FOR THE FUNCTION

DV_UP_Conversions

%% FUNCTION

ElectronDonor_O2_BO=O2_Influent*electron_eq_O2/electron_eq_Acetate; 
%Concentration of electron donor (mmole/L) to remove oxygen from 1L of treated water
ElectronDonor_ClO4_BO=umole_mmole*(ClO4_Influent-ClO4_Effluent_15)...
    *electron_eq_ClO4/electron_eq_Acetate; 
%Concentration of electron donor (mmole/L) to remove perchlorate 


%Setup matrices for the solver - cuts down on calculation time considerably
NO3_Effluent_BO_Sym=zeros(nsample,1);
NO3_Effluent_BO_15=zeros(nsample,1);
Delta_NO3_BO_15=zeros(nsample,1);

